const products = [
    {id: 1, image: './Images/blackTankTop.png', title: "Tank Top - Black", description: "Our High Quality Scoop Neck Tank Top is made from bamboo fibers sourced through eco-friendly methods", price: 10.99},
    {id: 2, image: './Images/blueHat.png', title: "Baseball Cap - Blue", description: "Our High Quality baseball cap is made from 100% cotton sourced through eco-friendly methods", price: 15.99},
    {id: 3, image: './Images/blackpants.png', title: "Straight-Legged Pants - Black", description: "Our High Quality straight-legged pants are made from bamboo fibers and cotton sourced through eco-friendly methods", price: 24.99},
    {id: 4, image: './Images/pinkShirt.png', title: "Long Sleeve Crew Neck - Pink", description: "Our High Quality Long Sleeve Crew Neck is made from bamboo fibers and cotton sourced through eco-friendly methods", price: 20.99},
]

function ProductFeed({addToCart}) {
    return (
        <div id="home" className="page">
            <h2>Products</h2>
            {products.map(product => (
                <div key={product.id} className="product">
                    <h3>{product.title}</h3>
                    <p>Price: ${product.price}</p>
                    <button onClick={() => addToCart(product)}>Add To Cart</button>
                </div>
            ))}
        </div>
    );
}

export default ProductFeed;
